Cairo VM is the virtual machine for the Cairo language. The one using here is the Python version cairo-lang . There is breaking change from Cairo0 to Cairo1 and the VM doesn't seem to work with Cairo1 code yet (??? or I'm wrong), so the example will use the Cairo0 code. %builtins range_check from starkware.cairo.common.bool import TRUE, FALSE
from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.math import abs_value func compare_abs_arrays{range_check_ptr: felt}( array_a: felt*, array_b: felt*, array_length: felt, iterator: felt
) -> (r: felt) { if (iterator == array_length) { return (TRUE,); } let abs_a = abs_value(array_a[iterator]); let abs_b = abs_value(array_b[iterator]); if (abs_a != abs_b) { return (FALSE,); } return compare_abs_arrays(array_a, array_b, array_length, iterator + 1);
} func fill_array(array: felt*, base: felt, step: felt, array_length: felt, iterator: felt) { if (iterator == array_length) { return (); } assert array[iterator] = base + step * iterator; return fill_array(array, base, step, array_length, iterator + 1);
} func main{range_check_ptr: felt}() { alloc_locals; tempvar array_length = 10; let (array_a: felt*) = alloc(); let (array_b: felt*) = alloc(); fill_array(array_a, -7, -3, array_length, 0); fill_array(array_b, 7, 3, array_length, 0); let result: felt = compare_abs_arrays(array_a, array_b, array_length, 0); assert result = TRUE; return ();
} Pseudo code: Generates 2 arrays, array_a and array_b, with the same length and the same values, but with different signs. Compares the absolute values of the elements of the arrays and returns TRUE if they are equal. We want to prove that the execution of the Cairo program was done correctly and the main function returns TRUE. Install the Cairo VM: cd code/stark/cairo-example
python -m venv cairo-vm-venv
source cairo-vm-venv/bin/activate
pip install cairo-lang To make sure that the Cairo VM is installed correctly and we are using the right binary, run which cairo-compile. It should return the path to the Cairo VM binary ...cairo-example/cairo-vm-venv/bin/cairo-compile Compile the Cairo program: cairo-compile abs_value_array/abs_value_array.cairo --output abs_value_array/abs_value_array.json Run the program and generate the trace: cairo-run --program=abs_value_array/abs_value_array.json --layout=small --memory_file=abs_value_array/memory.bin --trace_file=abs_value_array/trace.bin --print_info # Valid choices for --layout are: 'plain', 'small', 'dex', 'recursive', 'starknet', 'recursive_large_output', 'all_solidity', 'starknet_with_keccak', 'dynamic'
